import React, { useState } from 'react'

const Task = (props) => {
  return (
    <div className="d-flex">
      {props.taskTitle}

      <button
        onClick={props.toggleComplete}
        className="btn btn-outline-secondary"
      >
        {props.isComplete ? 'redo' : 'Done'}
      </button>

      <button className="btn btn-danger" onClick={props.handleDelete}>
        Delete
      </button>
    </div>
  )
}

export default Task
